import { CodegenConfig } from "@graphql-codegen/cli";

const graphqlURI = "https://flyby-gateway.herokuapp.com/";

const config: CodegenConfig = {
  schema: graphqlURI,
  documents: ["src/**/*.tsx"],
  generates: {
    "./src/__generated__/": {
      preset: "client",
      plugins: [],
      presetConfig: {
        gqlTagName: "gql",
      },
    },
  },
  ignoreNoDocuments: true,
};

export { config, graphqlURI };
